webpackJsonp([7563294071887],{2741:function(e,a){e.exports={data:{allTalkJson:{edges:[{node:{description:"With Spring and Hibernate on your stack, your application's bytecode is likely enhanced or manipulated at runtime. This session examines three common byte code manipulation frameworks: ASM, CGLib, and Javassist (Java Programming Assistant). We will discuss how these tools work and why frameworks like Spring use them. You will learn enough to begin integrating these frameworks directly into your own code.",meta:{duration:"PT55M1S"},presenter:{name:"Ashley Puls"},source:{id:"39kdr1mNZ_s",provider:"youtube"},slug:"living-in-the-matrix-with-bytecode-manipulation",tag:["Spring Framework","Java"],thumbnails:{default:{url:"https://i.ytimg.com/vi/39kdr1mNZ_s/default.jpg",height:90,width:120}},title:"Living in the Matrix with Bytecode Manipulation"}},{node:{description:"There is a good amount of excitement about the new version of Java. The big evolution of course is the lambda expressions. In this presentation we will dive into the language features in Java 8, take a look at some of their nuances, and look at ways to put them to good use. In addition to looking at lambdas we will also dive into the Streams capabilities and also some of the features in Java 8 that make all these possible.",meta:{duration:"PT1H25M27S"},presenter:{name:"Venkat Subramaniam"},source:{id:"j9nj5dTo54Q",provider:"youtube"},slug:"java-8-language-capabilities-whats-in-it-for-you",tag:["Spring Framework","Java"],thumbnails:{default:{url:"https://i.ytimg.com/vi/j9nj5dTo54Q/default.jpg",height:90,width:120}},title:"Java 8 Language Capabilities, What's in it for you?"}}]}},pathContext:{slug:"spring-framework",tag:"Spring Framework"}}}});
